import React from 'react'

function Card(props){
    return (
                <div className="border border-gray-300 p-6 rounded-lg">
                    <img src = {props.info.image} />
                    <h2 className="text-lg  font-medium title-font mb-2">{props.info.title}</h2>
                    <p className="leading-relaxed text-base">{props.info.description}</p>
                    <a href = {props.info.map}><button className="border border-indigo-500 bg-indigo-500 text-white rounded-md px-3 py-2 mt-2 transition duration-500 ease select-none hover:bg-indigo-600 focus:outline-none focus:shadow-outline">GoogleMap</button></a>
                </div>
    )
}

export default Card
